    return ( 
        <div className="about-us">
            <h1>What should i buy?</h1>
            <br />
            <div className="text">
                Welcome to the world of smartwatches! Smartwatches represent the pinnacle of technological design and practicality. In our wide range of smartwatches, you'll find the perfect blend of style, functionality, and advanced technology. How to choose the right smartwatch for you? Consider your needs: start by thinking about how you plan to use your new smartwatch. Do you need activity tracking, message and call notifications, or do you want a stylish accessory for every occasion?

